import React from "react";

class Modal3 extends React.Component {
  render() {
    return (
      <>
        <div className="modal modal-1">
          <h3>Step3</h3>
          <div className="mt8"></div>
          <div className="explain">
            <h2>絵を生成する</h2>
            <p className="mt8 fs12">飾りたい場所を引き目で撮影してください</p>
          </div>
        </div>
      </>
    );
  }
}

export default Modal3;
